import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>AI 履歷健診平台 Demo</h1>
      <p>請先登入以使用平台功能</p>
      <button onClick={() => navigate('/login')}>登入</button>
    </div>
  );
}

export default Home;
